sap.ui.define(["./BaseController"],function(e){"use strict";return e.extend("com.myorg.myUI5App.controller.MainOverview",{onBeforeRendering:function(){this._setDefault()},_setDefault:function(){let e=this.getView();e.setModel(new sap.ui.model.json.JSONModel,"overview");this._overviewModel=e.getModel("overview");this.getUsers();this.getRoles();this.getRoleCollections()},getUsers:function(){this.callSDK("GET","/app/users",undefined,this.setUsers)},getRoleCollections:function(){this.callSDK("GET","/app/role-collection",undefined,this.setRoleCollections)},getRoles:function(){this.callSDK("GET","/app/roles",undefined,this.setRoles)},setUsers:function(e){this._overviewModel.setProperty("/users",e)},setRoleCollections:function(e){this._overviewModel.setProperty("/collections",e)},setRoles:function(e){this._overviewModel.setProperty("/roles",e)},onTilePress:function(e){let t=this.getCustomDataKey(e.getSource());this.navTo(t)}})});